INSERT INTO `config_info` VALUES (1, 'application-common-dev.yml', 'DEFAULT_GROUP', 'spring:\n  # redis配置 \n  redis:\n    # Redis数据库索引（默认为0）\n    database: 0\n    # Redis服务器地址\n    host: 192.168.164.128\n    # Redis服务器连接端口\n    port: 6379\n    # Redis服务器连接密码（默认为空）\n    # password: \n    # 连接超时时间（毫秒）\n    timeout: 1000ms\n    lettuce:\n        pool:\n          # 连接池最大连接数\n          max-active: 200\n          # 连接池最大阻塞等待时间（使用负值表示没有限制）\n          max-wait: -1ms\n          # 连接池中的最大空闲连接\n          max-idle: 10\n          # 连接池中的最小空闲连接\n          min-idle: 0\nseata:\n  enabled: true\n  enable-auto-data-source-proxy: true\n  tx-service-group: my_test_tx_group\n  registry:\n    type: nacos\n    nacos:\n      application: seata-server\n      server-addr: 192.168.164.128:8848\n      username: nacos\n      password: nacos\n  config:\n    type: nacos\n    nacos:\n      server-addr: 192.168.164.128:8848\n      group: SEATA_GROUP\n      username: nacos\n      password: nacos\n      namespace: 465a28fb-e8f1-48ba-ae78-9dd9d77d166e\n  service:\n    vgroup-mapping:\n      my_test_tx_group: default\n    disable-global-transaction: false\n  client:\n    rm:\n      report-success-enable: false\nmybatis-plus:\n  global-config:\n    # 关闭MP3.0自带的banner\n    banner: false\n    db-config:\n      #主键类型 默认使用雪花ID\n      # id-type: AUTO\n      #字段策略\n      insert-strategy: not_null\n      update-strategy: not_null\n      select-strategy: not_empty\n      #驼峰下划线转换\n      table-underline: true\n      # 逻辑删除配置\n      # 逻辑删除全局值（1表示已删除，这也是Mybatis Plus的默认配置）\n      logic-delete-value: 1\n      # 逻辑未删除全局值（0表示未删除，这也是Mybatis Plus的默认配置）\n      logic-not-delete-value: 0\n  configuration:\n    # 是否开启自动驼峰命名规则映射:从数据库列名到Java属性驼峰命名的类似映射\n    map-underscore-to-camel-case: true\n    # 返回map时true:当查询数据为空时字段返回为null,false:不加这个查询数据为空时，字段将被隐藏\n    call-setters-on-nulls: true', '9e94de09009d469cfc308b1443658699', '2021-04-14 07:06:43', '2021-05-11 03:17:12', NULL, '192.168.164.1', '', '', '', '', '', 'yaml', '');
