INSERT INTO `his_config_info` VALUES (0, 1, 'application-common-dev.yml', 'DEFAULT_GROUP', '', '# 端口\r\n#server:\r\n#    port: 8099\r\n\r\nspring: \r\n    # 数据源配置\r\n    datasource: \r\n        type: com.alibaba.druid.pool.DruidDataSource\r\n        url: jdbc:mysql://127.0.0.1:3306/sp-dev?useUnicode=true&characterEncoding=utf-8&useSSL=true&serverTimezone=UTC\r\n        username: root\r\n        password: root123456 \r\n        # 是否打开sql监控台  (生产环境请务必关闭此选项) \r\n        druid: \r\n            stat-view-servlet:\r\n                enabled: true\r\n            web-stat-filter: \r\n                enabled: true\r\n            filter:\r\n                config:\r\n                    enabled: true\r\n\r\n    # redis配置 \r\n    redis:\r\n        # Redis数据库索引（默认为0）\r\n        database: 1\r\n        # Redis服务器地址\r\n        host: 127.0.0.1\r\n        # Redis服务器连接端口\r\n        port: 6379\r\n        # Redis服务器连接密码（默认为空）\r\n        # password: \r\n        # 连接超时时间（毫秒）\r\n        timeout: 1000ms\r\n        lettuce:\r\n            pool:\r\n                # 连接池最大连接数\r\n                max-active: 200\r\n                # 连接池最大阻塞等待时间（使用负值表示没有限制）\r\n                max-wait: -1ms\r\n                # 连接池中的最大空闲连接\r\n                max-idle: 10\r\n                # 连接池中的最小空闲连接\r\n                min-idle: 0\r\n        \r\n    # 项目自定义配置 \r\n    myconfig: \r\n        # 本项目部署到的服务器域名（文件上传等等模块  要用到）\r\n        domain: http://127.0.0.1:8099\r\n    ', 'd5af13fe98532795c3ef92a6b7062cf9', '2021-04-14 07:06:43', '2021-04-14 07:06:43', NULL, '192.168.164.1', 'I', '');
INSERT INTO `his_config_info` VALUES (0, 2, 'application-common.yml', 'DEFAULT_GROUP', '', 'spring: \r\n    # profiles: \r\n        # 启动环境加载，同时加载两个的写法：common,prod  优先级左>右\r\n        # active: core-dev\r\n        # active: test\r\n        # active: prod\r\n        \r\n# ================ 公共配置(优先级低于application-xxx.yml)  ================ \r\n    # mvc设置\r\n    mvc: \r\n        format: \r\n            # 日期映射格式\r\n            date: yyyy-MM-dd HH:mm:ss\r\n    # servlet配置 \r\n    servlet: \r\n        # 单文件大小限制1024M，避免文件上传时因为文件过大而被限制 \r\n        multipart: \r\n            max-file-size: 1024MB\r\n            max-request-size: 1024MB\r\n            \r\n        \r\n    # jackson设置 \r\n    jackson:\r\n        # 默认的日期转换格式  \r\n        date-format: yyyy-MM-dd HH:mm:ss\r\n        # 解决因为时区问题，date少8小时的bug \r\n        # time-zone: GMT+8\r\n        \r\n    # 项目自定义配置 \r\n    myconfig: \r\n        # md5的盐\r\n        md5_salt: whatclickme\r\n        # 是否明文存储密码 \r\n        is_pw: true\r\n    \r\n        \r\n        \r\n# mybatis-plus配置  \r\nmybatis-plus: \r\n    # 配置别名包，在mapper.xml中可以直接返回SoMap\r\n    type-aliases-package: com.pj.utils.sg\r\n    # 一些配置\r\n    configuration: \r\n        # 控制打印sql \r\n        log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\r\n        # 是否开启下划线转驼峰 \r\n        map-underscore-to-camel-case: false\r\n      \r\n# 是否开启服务降级 \r\nfeign.hystrix.enabled: true\r\n# 服务单次调用超时秒数，超时后触发降级\r\nhystrix.command.default.execution.isolation.thread.timeoutInMilliseconds: 30000\r\n\r\n\r\n\r\n        ', 'a19f3d8c3c6a0a9d2454ab88710adb83', '2021-04-14 07:06:43', '2021-04-14 07:06:43', NULL, '192.168.164.1', 'I', '');
INSERT INTO `his_config_info` VALUES (0, 3, 'sp-gateway.yml', 'DEFAULT_GROUP', '', 'spring:\r\n    cloud:\r\n        gateway:\r\n          discovery:\r\n            locator:\r\n              #开启根据微服务名称自动转发\r\n              enabled: true\r\n              #微服务名称以小写形式呈现 \r\n              lower-case-service-id: true\r\n            ', '38e6bc3a499790cf09bfdc9534e80c1d', '2021-04-14 07:06:43', '2021-04-14 07:06:43', NULL, '192.168.164.1', 'I', '');
INSERT INTO `his_config_info` VALUES (1, 4, 'application-common-dev.yml', 'DEFAULT_GROUP', '', '# 端口\r\n#server:\r\n#    port: 8099\r\n\r\nspring: \r\n    # 数据源配置\r\n    datasource: \r\n        type: com.alibaba.druid.pool.DruidDataSource\r\n        url: jdbc:mysql://127.0.0.1:3306/sp-dev?useUnicode=true&characterEncoding=utf-8&useSSL=true&serverTimezone=UTC\r\n        username: root\r\n        password: root123456 \r\n        # 是否打开sql监控台  (生产环境请务必关闭此选项) \r\n        druid: \r\n            stat-view-servlet:\r\n                enabled: true\r\n            web-stat-filter: \r\n                enabled: true\r\n            filter:\r\n                config:\r\n                    enabled: true\r\n\r\n    # redis配置 \r\n    redis:\r\n        # Redis数据库索引（默认为0）\r\n        database: 1\r\n        # Redis服务器地址\r\n        host: 127.0.0.1\r\n        # Redis服务器连接端口\r\n        port: 6379\r\n        # Redis服务器连接密码（默认为空）\r\n        # password: \r\n        # 连接超时时间（毫秒）\r\n        timeout: 1000ms\r\n        lettuce:\r\n            pool:\r\n                # 连接池最大连接数\r\n                max-active: 200\r\n                # 连接池最大阻塞等待时间（使用负值表示没有限制）\r\n                max-wait: -1ms\r\n                # 连接池中的最大空闲连接\r\n                max-idle: 10\r\n                # 连接池中的最小空闲连接\r\n                min-idle: 0\r\n        \r\n    # 项目自定义配置 \r\n    myconfig: \r\n        # 本项目部署到的服务器域名（文件上传等等模块  要用到）\r\n        domain: http://127.0.0.1:8099\r\n    ', 'd5af13fe98532795c3ef92a6b7062cf9', '2021-04-14 07:10:28', '2021-04-14 07:10:27', 'nacos', '192.168.164.1', 'U', '');
INSERT INTO `his_config_info` VALUES (0, 5, 'hj-gateway.yml', 'DEFAULT_GROUP', '', 'spring:\r\n    cloud:\r\n        gateway:\r\n          discovery:\r\n            locator:\r\n              #开启根据微服务名称自动转发\r\n              enabled: true\r\n              #微服务名称以小写形式呈现 \r\n              lower-case-service-id: true\r\n            ', '38e6bc3a499790cf09bfdc9534e80c1d', '2021-04-14 07:12:04', '2021-04-14 07:12:04', NULL, '192.168.164.1', 'I', '');
