INSERT INTO `his_config_info` VALUES (1, 267, 'application-common-dev.yml', 'DEFAULT_GROUP', '', '# 端口\n#server:\n#    port: 8099\n\nspring: \n    # 数据源配置\n    datasource: \n        type: com.alibaba.druid.pool.DruidDataSource\n        url: jdbc:mysql://192.168.164.128:3306/hj-dev?useUnicode=true&characterEncoding=utf-8&useSSL=true&serverTimezone=UTC\n        username: root\n        password: 123456 \n        # 是否打开sql监控台  (生产环境请务必关闭此选项) \n        druid: \n            stat-view-servlet:\n                enabled: true\n            web-stat-filter: \n                enabled: true\n            filter:\n                config:\n                    enabled: true\n\n    # redis配置 \n    redis:\n        # Redis数据库索引（默认为0）\n        database: 1\n        # Redis服务器地址\n        host: 192.168.164.128\n        # Redis服务器连接端口\n        port: 6379\n        # Redis服务器连接密码（默认为空）\n        # password: \n        # 连接超时时间（毫秒）\n        timeout: 1000ms\n        lettuce:\n            pool:\n                # 连接池最大连接数\n                max-active: 200\n                # 连接池最大阻塞等待时间（使用负值表示没有限制）\n                max-wait: -1ms\n                # 连接池中的最大空闲连接\n                max-idle: 10\n                # 连接池中的最小空闲连接\n                min-idle: 0\n        \n    # 项目自定义配置 \n    myconfig: \n        # 本项目部署到的服务器域名（文件上传等等模块  要用到）\n        domain: http://127.0.0.1:8099\n    ', '0a0444ce2d7e2a2ed822f89bf2b4a7d6', '2021-04-15 03:06:01', '2021-04-15 03:06:01', 'nacos', '192.168.164.1', 'U', '');
