INSERT INTO `his_config_info` VALUES (1, 269, 'application-common-dev.yml', 'DEFAULT_GROUP', '', '# 端口\n#server:\n#    port: 8099\n\nspring: \n    # redis配置 \n    redis:\n        # Redis数据库索引（默认为0）\n        database: 1\n        # Redis服务器地址\n        host: 192.168.164.128\n        # Redis服务器连接端口\n        port: 6379\n        # Redis服务器连接密码（默认为空）\n        # password: \n        # 连接超时时间（毫秒）\n        timeout: 1000ms\n        lettuce:\n            pool:\n                # 连接池最大连接数\n                max-active: 200\n                # 连接池最大阻塞等待时间（使用负值表示没有限制）\n                max-wait: -1ms\n                # 连接池中的最大空闲连接\n                max-idle: 10\n                # 连接池中的最小空闲连接\n                min-idle: 0\n        \n    # 项目自定义配置 \n    myconfig: \n        # 本项目部署到的服务器域名（文件上传等等模块  要用到）\n        domain: http://127.0.0.1:8099\n    ', 'e085d93f8cbe8d627d7f26d45074aaf8', '2021-04-20 06:32:31', '2021-04-20 06:32:31', 'nacos', '0:0:0:0:0:0:0:1', 'U', '');
INSERT INTO `his_config_info` VALUES (2, 270, 'application-common.yml', 'DEFAULT_GROUP', '', 'spring: \r\n    # profiles: \r\n        # 启动环境加载，同时加载两个的写法：common,prod  优先级左>右\r\n        # active: core-dev\r\n        # active: test\r\n        # active: prod\r\n        \r\n# ================ 公共配置(优先级低于application-xxx.yml)  ================ \r\n    # mvc设置\r\n    mvc: \r\n        format: \r\n            # 日期映射格式\r\n            date: yyyy-MM-dd HH:mm:ss\r\n    # servlet配置 \r\n    servlet: \r\n        # 单文件大小限制1024M，避免文件上传时因为文件过大而被限制 \r\n        multipart: \r\n            max-file-size: 1024MB\r\n            max-request-size: 1024MB\r\n            \r\n        \r\n    # jackson设置 \r\n    jackson:\r\n        # 默认的日期转换格式  \r\n        date-format: yyyy-MM-dd HH:mm:ss\r\n        # 解决因为时区问题，date少8小时的bug \r\n        # time-zone: GMT+8\r\n        \r\n    # 项目自定义配置 \r\n    myconfig: \r\n        # md5的盐\r\n        md5_salt: whatclickme\r\n        # 是否明文存储密码 \r\n        is_pw: true\r\n    \r\n        \r\n        \r\n# mybatis-plus配置  \r\nmybatis-plus: \r\n    # 配置别名包，在mapper.xml中可以直接返回SoMap\r\n    type-aliases-package: com.pj.utils.sg\r\n    # 一些配置\r\n    configuration: \r\n        # 控制打印sql \r\n        log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\r\n        # 是否开启下划线转驼峰 \r\n        map-underscore-to-camel-case: false\r\n      \r\n# 是否开启服务降级 \r\nfeign.hystrix.enabled: true\r\n# 服务单次调用超时秒数，超时后触发降级\r\nhystrix.command.default.execution.isolation.thread.timeoutInMilliseconds: 30000\r\n\r\n\r\n\r\n        ', 'a19f3d8c3c6a0a9d2454ab88710adb83', '2021-04-20 06:34:01', '2021-04-20 06:34:00', 'nacos', '0:0:0:0:0:0:0:1', 'U', '');
