INSERT INTO `his_config_info` VALUES (0, 478, 'ddcat-auth-dev.yml', 'DEFAULT_GROUP', '', 'spring:\n  # redis配置 \n  redis:\n    # Redis数据库索引（默认为0）\n    database: 1\n    # Redis服务器地址\n    host: 192.168.164.128\n    # Redis服务器连接端口\n    port: 6379\n    # Redis服务器连接密码（默认为空）\n    # password: \n    # 连接超时时间（毫秒）\n    timeout: 1000ms\n    lettuce:\n        pool:\n          # 连接池最大连接数\n          max-active: 200\n          # 连接池最大阻塞等待时间（使用负值表示没有限制）\n          max-wait: -1ms\n          # 连接池中的最大空闲连接\n          max-idle: 10\n          # 连接池中的最小空闲连接\n          min-idle: 0\n  jpa:\n    database: mysql\n    show-sql: true\n    database-platform: org.hibernate.dialect.MySQL5InnoDBDialect\n    hibernate:\n      ddl-auto: update\n  shardingsphere:\n    datasource:\n      names: master,slave0\n      master:\n        type: com.alibaba.druid.pool.DruidDataSource\n        driver-class-name: com.mysql.cj.jdbc.Driver\n        url: jdbc:mysql://192.168.164.128:3306/ddcat?useUnicode=true&characterEncoding=utf-8&useSSL=true&serverTimezone=UTC\n        username: root\n        password: 123456\n      # 数据源 从库\n      slave0:\n        type: com.alibaba.druid.pool.DruidDataSource\n        driver-class-name: com.mysql.cj.jdbc.Driver\n        url: jdbc:mysql://192.168.164.128:3307/ddcat?useUnicode=true&characterEncoding=utf-8&useSSL=true&serverTimezone=UTC\n        username: root\n        password: 123456\n    #分库分表\n    # sharding:\n      # tables:\n      #   db_user:\n      #     #如果配置了master-slave-rules则需要用其中配置的数据源\n      #     actual-data-nodes: db_master_0.db_user_$->{0..4}\n      #     #分表策略\n      #     table-strategy:\n      #       inline:\n      #         sharding-column: id\n      #         algorithm-expression: db_user_$->{id % 5}\n      #       # 分表策略，自定义分表策略\n      #       standard:\n      #         sharding-column: id\n      #         precise-algorithm-class-name: com.cloud.sharding.config.UserShardingTableAlgorithm\n    #   master-slave-rules:\n    #     db_master_0:\n    #       name: ms\n    #       master-data-source-name: master\n    #       slave-data-source-names: slave0\n    # 读写分离\n    masterslave:\n        load-balance-algorithm-type: round_robin\n        name: ms\n        master-data-source-name: master\n        slave-data-source-names: slave0\n    #打印sql\n    props:\n      sql:\n        show: true\nseata:\n  enabled: true\n  enable-auto-data-source-proxy: true\n  tx-service-group: my_test_tx_group\n  registry:\n    type: nacos\n    nacos:\n      application: seata-server\n      server-addr: 192.168.164.128:8848\n      username: nacos\n      password: nacos\n  config:\n    type: nacos\n    nacos:\n      server-addr: 192.168.164.128:8848\n      group: SEATA_GROUP\n      username: nacos\n      password: nacos\n      namespace: 465a28fb-e8f1-48ba-ae78-9dd9d77d166e\n  service:\n    vgroup-mapping:\n      my_test_tx_group: default\n    disable-global-transaction: false\n  client:\n    rm:\n      report-success-enable: false', '7cdb4211314115ad79021df15674e614', '2021-05-08 09:24:17', '2021-05-08 09:24:17', NULL, '192.168.164.1', 'I', '');
INSERT INTO `his_config_info` VALUES (274, 479, 'ddcat-gateway.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          # 是否和服务注册与发现组件结合，设置为 true 后可以直接使用应用名称调用服务\n          enabled: true\n          \n      routes:\n        - id: ddcat-system\n          uri: lb://ddcat-system\n          predicates:\n            - Path=/system/**\n          filters:\n            - StripPrefix=1\n\n        - id: ddcat-job\n          uri: lb://ddcat-job\n          predicates:\n            - Path=/job/**\n          filters:\n            - StripPrefix=1', '5badf9413b2a0178022f53c803abbd2e', '2021-05-08 09:36:44', '2021-05-08 09:36:44', NULL, '192.168.164.1', 'U', '');
