INSERT INTO `his_config_info` VALUES (1, 509, 'application-common-dev.yml', 'DEFAULT_GROUP', '', 'spring:\n  redis:\n    password:    # 密码（默认为空）\n    timeout: 6000ms  # 连接超时时长（毫秒）\n    cluster:\n      nodes: #这里上你Redis的各个端口号\n        - 192.168.164.128:6379\n        - 192.168.164.128:7000\n    jedis:\n      pool:\n        max-active: 1000  # 连接池最大连接数（使用负值表示没有限制）\n        max-wait: -1ms      # 连接池最大阻塞等待时间（使用负值表示没有限制）\n        max-idle: 10      # 连接池中的最大空闲连接\n        min-idle: 5       # 连接池中的最小空闲连接\n', '898c7fa3f5e9cb5aa8602fc4514d3073', '2021-05-10 06:37:44', '2021-05-10 06:37:43', NULL, '192.168.164.1', 'U', '');
