INSERT INTO `his_config_info` VALUES (0, 747, 'ddcat-gateway-dev.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          # 是否和服务注册与发现组件结合，设置为 true 后可以直接使用应用名称调用服务\n          enabled: true\n          \n      routes:\n        - id: ddcat-auth\n          uri: lb://ddcat-auth\n          predicates:\n            - Path=/auth/**\n          filters:\n            - StripPrefix=1\n\n        - id: ddcat-system\n          uri: lb://ddcat-system\n          predicates:\n            - Path=/system/**\n          filters:\n            - StripPrefix=1\n\n        - id: ddcat-job\n          uri: lb://ddcat-job\n          predicates:\n            - Path=/job/**\n          filters:\n            - StripPrefix=1', 'd1f6b2887b0ed0b30a9a378b68262ee9', '2021-05-11 03:22:11', '2021-05-11 03:22:11', NULL, '192.168.164.1', 'I', '');
